import { Component, OnInit } from '@angular/core';
import { FormBuilder, Validators, FormGroup } from '@angular/forms';
import { Labor } from 'src/app/interfaces/labor';
import { LaborService } from 'src/app/services/labor.service';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-add-edit-labor',
  templateUrl: './add-edit-labor.component.html',
  styleUrls: ['./add-edit-labor.component.css']
})
export class AddEditLaborComponent implements OnInit{
  formLabor: FormGroup;
  id:number;
  operacion: string = 'Agregar ';

  constructor(private fb: FormBuilder,
    private router :Router,
    private aRouter: ActivatedRoute,
    private _laborService: LaborService){
    this.formLabor = this.fb.group({
      tipLabId: [null, Validators.required],
      nombreLab: ['', Validators.required],
      horasLab: [null, Validators.required]
    })
    this.id = Number( aRouter.snapshot.paramMap.get('id'));
    console.log(this.id);
  }

  ngOnInit(): void {
    if(this.id != 0){
      this.operacion= 'Editar ';
      this.getLabor(this.id);
    }
  }

  getLabor(id:number){
    this._laborService.getLabor(id).subscribe((data: Labor) =>{
      const lab: Labor = this.convertirLabor(data);
      this.formLabor.setValue({
        tipLabId: lab.idTipoLabor,
        nombreLab: lab.nombre,
        horasLab: lab.horas
      })
    })
  }

  addLabor(){
    console.log(this.formLabor.value.tipLabId);

    const labor: Labor = {
      idTipoLabor: this.formLabor.value.tipLabId,
      nombre: this.formLabor.value.nombreLab,
      horas: this.formLabor.value.horasLab
    }
    if(this.id !== 0){
      //Editar 
      labor.id = this.id;
      this._laborService.updateLabor(labor).subscribe(()=>{
        console.log('labor update');
        this.router.navigate(['/labor']);
      })
    }else{
      //AGregar
      this._laborService.saveLabor(labor).subscribe(() => {
        console.log('labor agregada');
        this.router.navigate(['/labor']);
      })
    }

  }

  convertirLabor(labor: any): Labor{
    let resultado: Labor =({
      id: labor[0].atrLabID,
      idTipoLabor: labor[0].atrTlID,
      nombre: labor[0].atrLabNombre,
      horas: labor[0].atrLabHoras
    });
    return resultado;
  }
}
<div class="row mb-3 mt-10">
    <div class="col-lg4">
        <div class="card bg-secondary mb-3" style="max-width: 20rem;">
            <div class="card-header text-center">{{operacion}} Labor</div>
            <div class="card-body">
                <form [formGroup]="formLabor" (ngSubmit)="addLabor()">
                    <<label for="IDTipoLabor">Tipo Labor:</label>
                    <select formControlName="tipLab" id="tipoLabor" class="form-control" placeholder="Escoja el  tipo de labor">
                        <option >{{tipoLabor[0].id}}</option>
                        <option >{{tipoLabor[1].id}}</option>
                        <option >{{tipoLabor[2].id}}</option>
                        <option >{{tipoLabor[3].id}}</option>
                        <option >{{tipoLabor[4].id}}</option>
                        <option >{{tipoLabor[5].id}}</option>
                        <option >{{tipoLabor[6].id}}</option>
                        <option >{{tipoLabor[7].id}}</option>
                        <option >{{tipoLabor[8].id}}</option>
                        <option >{{tipoLabor[9].id}}</option>
                    </select>
                    <span *ngIf="formLaborAdd.get('tipoLabor')?.hasError('required') && formLaborAdd.get('tipoLabor')?.touched">
                         El campo ID tipo labor es <strong>requerido</strong>
                    </span>

                    <input formControlName="nombreLab" type="text" class="form-control" placeholder="Ingrese Nombre Labor">
                    <input formControlName="horasLab" type="number" class="form-control" placeholder="Ingrese Cantidad de Horas">
                    <div class="row mt-3 text-center">
                        <div class="col">
                            <button [disabled]="formLabor.invalid" type="submit" class="btn btn-secondary">Aceptar</button>
                        </div>
                        <div class="col">
                            <button routerLink="/labor" type="button" class="btn btn-secondary">Cancelar</button>
                        </div>
                    </div>
                </form>
            </div>
        </div>
    </div>
</div>
